query: "create or replace   view dbt_db.DBT_SAMPLE_elementary.job_run_results\n  \n\
  \   as (\n    \n\n\n\n\n\nwith jobs as (\n  select\n    job_name,\n    job_id,\n\
  \    job_run_id,\n    \nmin(cast(run_started_at as timestamp))\n as job_run_started_at,\n\
  \    \nmax(cast(run_completed_at as timestamp))\n as job_run_completed_at,\n   \
  \ \n    datediff(\n        second,\n        \nmin(cast(run_started_at as timestamp))\n\
  ,\n        \nmax(cast(run_completed_at as timestamp))\n\n        )\n as job_run_execution_time\n\
  \  from dbt_db.DBT_SAMPLE_elementary.dbt_invocations\n  where job_id is not ?\n\
  \  group by job_name, job_id, job_run_id\n)\n\nselect\n  job_name as name,\n  job_id\
  \ as id,\n  job_run_id as run_id,\n  job_run_started_at as run_started_at,\n  job_run_completed_at\
  \ as run_completed_at,\n  job_run_execution_time as run_execution_time\nfrom jobs\n\
  \  );"
